import React from "react";
import Swiper from "react-id-swiper";
import image1 from "../../../images/carousel-1.png";
import image2 from "../../../images/carousel-2.png";
import image3 from "../../../images/carousel-3.png";

const Carousels = () => {
  const params = {
    slidesPerView: 3,
    spaceBetween: 30,
    centeredSlides: true,
    pagination: {
      el: ".swiper-pagination",
      clickable: true,
    },
  };
  return (
    <Swiper className="bg-dark" {...params}>
      
        <img style={{ height: "10rem", width: "10rem" }} src={image1} alt="" />
      
      
        <img style={{ height: "10rem", width: "10rem" }} src={image2} alt="" />
     
        <img style={{ height: "10rem", width: "10rem" }} src={image3} alt="" />
      
    </Swiper>
  );
};

export default Carousels;
